import React, {Component,Fragment} from 'react';
import '../../../Asset/css/google-fonts/poppins.css';
import '../../../Asset/css/google-fonts/Roboto.css';
import '../../../Asset/fontawesome/css/all.css';
import '../../../Asset/ionicons/css/ionicons.min.css'
import '../../../Asset/css/bootstrap-css/bootstrap.min.css';
import '../../../Asset/css/animated-css/style.css';
import '../../../Asset/css/magnific-popup/magnific-popup.css';
import '../../../Asset/css/custom.css'
import {NavLink} from 'react-router-dom';
import {Link} from 'react-scroll'


class Header extends Component {
    render() {
        return (
            <Fragment>
                <div className="header">
                    <nav className="my_navbar">
                        <div className="nav_toggle">
                            <span className="bar bar_1"></span>
                            <span className="bar bar_2"></span>
                            <span className="bar bar_3"></span>
                        </div>

                        <div className="my_navbar_nav">
                            <ul className="text-center">
                                <li className="my_nav_item">
                                    <Link exact className="my_nav_link  py_10">
                                        activeClass="active"
                                        to="/"
                                        spy={true}
                                        smooth={true}
                                        offset={50}
                                        duration={500}
                                        <i className="fas fa-home"/>
                                        <span>Home</span>
                                    </Link>
                                </li>
                                <li className="my_nav_item">
                                    <Link exact className="my_nav_link py_10" to="/about">
                                        activeClass="active"
                                        to="/"
                                        spy={true}
                                        smooth={true}
                                        offset={50}
                                        duration={500}
                                        <i className="fas fa-user"></i>
                                        <span>About</span>
                                    </Link>
                                </li>
                                <li className="my_nav_item">
                                    <Link exact className="my_nav_link py_10" to="/service">
                                        activeClass="active"
                                        to="/"
                                        spy={true}
                                        smooth={true}
                                        offset={50}
                                        duration={500}
                                        <i className="fas fa-briefcase-medical"></i>
                                        <span>Service</span>
                                    </Link>
                                </li>
                                <li className="my_nav_item">
                                    <Link exact className="my_nav_link py_10" to="work">
                                        activeClass="active"
                                        to="/"
                                        spy={true}
                                        smooth={true}
                                        offset={50}
                                        duration={500}
                                        <i className="fas fa-clone"></i>
                                        <span>Works</span>
                                    </Link>
                                </li>
                                <li className="my_nav_item">
                                    <Link exact className="my_nav_link py_10" to="/blog">
                                        activeClass="active"
                                        to="/"
                                        spy={true}
                                        smooth={true}
                                        offset={50}
                                        duration={500}
                                        <i className="fas fa-blog"></i>
                                        <span>Blogs</span>
                                    </Link>
                                </li>
                                <li className="my_nav_item">
                                        <Link exact className="my_nav_link py_10" to="/contact">
                                            activeClass="active"
                                            to="/"
                                            spy={true}
                                            smooth={true}
                                            offset={50}
                                            duration={500}
                                            <i className="fas fa-address-book"></i>
                                            <span>Contact</span>
                                        </Link>
                                </li>
                            </ul>
                        </div>
                    </nav>
                </div>
            </Fragment>
        );
    }
}

export default Header;
